.ivu-layout-sider {
    overflow: scroll;
    padding-top: 61px;
}

.el-menu {
    border-right: 0 !important;
}

.el-menu-vertical-demo:not(.el-menu--collapse) {
    width: 200px;
}

.el-menu-item.logo.is-disabled {
    opacity: 1;
    cursor: default;
}

.el-menu-item.is-active {
    background-color: #fff !important;
    color: #333 !important;
}

.ivu-layout-sider::-webkit-scrollbar {
    display: none;
}

.ivu-layout-sider {
    height: 100%;
    background-color: #1d1d1d;
    color: #333;
}

.leftSide {
    z-index: 0;
    transition: 0.5s;
    position: relative;
    // 开关按钮
    .switch {
        position: absolute;
        right: -20px;
        top: calc(50% - 50px);
        /* font-size: 10px; */
        width: 20px;
        height: 50px;
        cursor: pointer;
        display: flex;
        -webkit-box-align: center;
        -ms-flex-align: center;
        align-items: center;
        -webkit-box-pack: center;
        -ms-flex-pack: center;
        justify-content: center;
        background: white;
        border-top-right-radius: 5px;
        border-bottom-right-radius: 5px;
        border: #7eb7f0 2px solid;
        border-left: 0;

        &:hover {
            filter: brightness(1.1);
        }

        i {
            font-size: 15px;
        }
    }
}

.leftSide_on {
    margin-left: -200px;
}
